import React from 'react'
import './Response.css'
const Response = ({name, rollno, classLocation, responseLocation}) => {
  return (
    <div className='container row p-3 m-2 box-shadow-3d' style={{borderRadius: "4px"}}>
    <div className='col'>{name}</div>
    <div className='col'>{rollno}</div>
    <div>Class: {classLocation.latitude} {classLocation.longitude} </div>
    { classLocation.latitude != responseLocation.latitude || classLocation.longitude != responseLocation.longitude &&
      <div className='col' style={{backgroundColor:"red", color:"white", borderRadius:"4px", fontWeight:"600"}}>LOCATION MISMATCH</div>
    }
    </div>
  )
}

export default Response
